('2349','23','6101','Antonio',Null,'Stadthotel mit 8 Suiten und Pool zu vermieten mit Kaufoption','33098','Dieses sehr gepflegte Stadthotel liegt im Stadtkern einer kleinen Stadt auf Mallorca. Das sehr gepflegte Hotel bietet außer 8 großzügig gestalteten Suiten auch ein Restaurant mit einer Profiküche. Alle Zimmer sind  mit einer Klimaanlage w/k ausgestattet.  Im Innenhof des Hotels befindet sich ein sehr schön angelegter Garten mit Pool, Liegewiese und überdachte Restaurantterrasse mit Platz für 120 Personen. Im Innenbereich hat es eine Profiküche,  begehbare Kühlzelle und ein Restaurant mit ca. 60 Plätzen. Ein privater Kundenparkplatz mit 10 Stellplätzen steht den Gästen zur Verfügung.','33099','3675000','106','2015-07-03 12:37:07','106','2015-07-03 12:37:57',Null,'2424','105','1140',1,'1','0',Null,Null,Null,'33100',Null,'0','0','0',Null,'2015-07-03 12:41:55',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33101',Null,'33102',Null,'33103',Null,'33104',Null,'33105','0',0,'4');
